MATCH (v:Vendor)-[:VENDOR]->(p:Product)-[:GROUP]->(:Product_Group {name: 'ARV'})
WHERE p.shipment_number STARTS WITH 'ASN'
RETURN DISTINCT v;

MATCH (p:Product)
WHERE p.item_description CONTAINS 'Tablets' AND p.project_code ENDS WITH 'T01'
RETURN p;

MATCH (p:Product)-[:GROUP]->(:Product_Group {name: 'ARV'})
WHERE p.project_code STARTS WITH '100'
RETURN p;

MATCH (p:Product)-[:GROUP]->(pg:Product_Group)
MATCH (p)-[:MANAGED_BY]->(:Office {name: 'Haiti Field Office'})
RETURN DISTINCT pg.name;

MATCH (v:Vendor)-[:VENDOR]->(p:Product)
WHERE p.project_code STARTS WITH '102' AND p.project_code IS NOT NULL
RETURN v, p;

MATCH (p:Product)
WHERE p.unit_of_measure_per_pack > 50
RETURN p;

MATCH (p:Product)-[:SUB_CLASS]->(:Sub_Class{name: 'HIV test'})
MATCH (o:Office)-[:MANAGED_BY]->(p)
RETURN count(DISTINCT o) AS NumberOfOffices;

MATCH (p:Product)-[:MANAGED_BY]->(:Office{name: 'Haiti Field Office'})
WHERE p.pack_price IS NOT NULL AND toFloat(p.pack_price) > 100
RETURN p;
